import './App.css';
import React, { useState, useEffect } from "react";
import { instance } from './agent';

function App() {

  const [aa,setaa] = useState("");

  useEffect (()=>{
    let getData = async () => {
      instance.get("/polls")
      .then(res => setaa(res.data.message))
      .catch(err => console.log(err.toJSON()))
    }
    getData();
  },[])


  return (
    <div className="App">
      <p>{aa}</p>
    </div>
  );
}

export default App;
